If(rst_n._eq(0),
    r_cnt(2),
    rise(1),
    f_cnt(1),
    fall(0)
).Else(
    If(clk._onRisingEdge(),
        If(r_cnt._eq(2),
            r_cnt(0),
            rise(~rise)
        ).Else(
            r_cnt((r_cnt._reinterpret_cast(Bits(2, signed=False)) + 1)._reinterpret_cast(Bits(2)))
        )
    ),
    If(clk._onFallingEdge(),
        If(f_cnt._eq(2),
            f_cnt(0),
            fall(~fall)
        ).Else(
            f_cnt((f_cnt._reinterpret_cast(Bits(2, signed=False)) + 1)._reinterpret_cast(Bits(2)))
        )
    )
)
